/*
For testing using the Ethereum Bridge on localhost.
Requires setting to your own resolver.
*/

pragma solidity ^0.4.10;
import "./USDETHOracle.sol";

contract USDETHOracle_localhost is USDETHOracle {

    function USDETHOracle_localhost(address _admin, uint256 _interval) USDETHOracle(_admin, _interval) public {
        OAR = OraclizeAddrResolverI(0x6f485C8BF6fc43eA212E93BBF8ce046C7f1cb475); //replace with new address when run again
    }

}
